import React from "react";
import Typical from "react-typical";

const Logo = (props) => {
  return (
    <div className={props.style}>
      <h2>
        Hi, I am{" "}
        <Typical loop={Infinity} wrapper="b" steps={["Xinyu Tang", 1000]} />
      </h2>
      <p>
        I am a{" "}
        <Typical loop={Infinity} wrapper="b" steps={["web developer", 1000]} />
      </p>
    </div>
  );
};

export default Logo;
